  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
`;

const Gallery = () => {
  return (
    <GalleryStyled>
      {GalleryImg.map((img, idx) => {
        return <img src={img} key={idx} alt={`img${idx}`} />;
      })}
    </GalleryStyled>
  );
};

export default Gallery;
